  Circle,
  Box,
  Flex,
  Spacer,
  Heading,
  Avatar,
  AvatarBadge,
  AvatarGroup,
} from "@chakra-ui/react";

const Landing = () => {
  return (
    <div>
      <box>
        {" "}
        <Button colorScheme="blue" to="/login">
          Login/Signup
