        </Box>
        <Spacer />
        <Box bg="gray.400" w="200px" h="200px">
          {" "}
          Dev Profile{" "}
        </Box>
        <Spacer />
        <Box bg="gray.400" w="200px" h="200px">
          {" "}
          Dev Profile{" "}
        </Box>
        <Spacer />
        <Box bg="gray.400" w="200px" h="200px">
          {" "}
          Dev Profile{" "}
        </Box>
      </Flex>
    </div>
  );
};

export default Landing;
